			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "## 1. DEFINE SETTINGS\n\n# Sets the target folders and the final framework product.\nFMK_NAME=PhotoPayCloud  \nFMK_VERSION=A\n\n# Project name\nPROJ_NAME=PhotoPayCloudSDK\n\n# Target names\nSDK_TARGET=PhotoPayCloudSDK\nRES_TARGET=PhotoPayCloudResources\nRES_BUNDLE=PhotoPayCloudResources\n\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\nPRODUCTS_DIR=${SRCROOT}/..\nTEMP_DIR=${PRODUCTS_DIR}/Temp\nINSTALL_DIR=${TEMP_DIR}/${FMK_NAME}.framework\n\n# Working dir will be deleted after the framework creation.\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/${CONFIGURATION}-iphoneos/\nSIMULATOR_DIR=${WRK_DIR}/${CONFIGURATION}-iphonesimulator/\n\n## 2. BUILD ALL\n\n# Building both architectures.\n\n# SDK target\nxcodebuild -project \"${PROJ_NAME}.xcodeproj\" -configuration \"${CONFIGURATION}\" -target \"${SDK_TARGET}\" -sdk iphoneos CODE_SIGN_IDENTITY=\"iPhone Developer\"\n\nxcodebuild -project \"${PROJ_NAME}.xcodeproj\" -configuration \"${CONFIGURATION}\" -target \"${SDK_TARGET}\" -sdk iphonesimulator CODE_SIGN_IDENTITY=\"iPhone Developer\"\n\n# Resources target\nxcodebuild -project \"${PROJ_NAME}.xcodeproj\" -configuration \"${CONFIGURATION}\" -target \"${RES_TARGET}\" -sdk iphoneos CODE_SIGN_IDENTITY=\"iPhone Developer\"\n\nxcodebuild -project \"${PROJ_NAME}.xcodeproj\" -configuration \"${CONFIGURATION}\" -target \"${RES_TARGET}\" -sdk iphonesimulator CODE_SIGN_IDENTITY=\"iPhone Developer\"\n\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\n\n## 3. CREATE FRAMEWORK\n\n# Creates and renews the final product folder.\nmkdir -p \"${INSTALL_DIR}\"\nmkdir -p \"${INSTALL_DIR}/Versions\"\nmkdir -p \"${INSTALL_DIR}/Versions/${FMK_VERSION}\"\nmkdir -p \"${INSTALL_DIR}/Versions/${FMK_VERSION}/Resources\"\nmkdir -p \"${INSTALL_DIR}/Versions/${FMK_VERSION}/Headers\"\n\n# Creates the internal links.\n# It MUST uses relative path, otherwise will not work when the folder is copied/moved.\nln -s \"${FMK_VERSION}\" \"${INSTALL_DIR}/Versions/Current\"\nln -s \"Versions/Current/Headers\" \"${INSTALL_DIR}/Headers\"\nln -s \"Versions/Current/Resources\" \"${INSTALL_DIR}/Resources\"\nln -s \"Versions/Current/${FMK_NAME}\" \"${INSTALL_DIR}/${FMK_NAME}\"\n\n# Copies the headers and resources files to the final product folder.\ncp -R \"${DEVICE_DIR}/usr/local/include/\" \"${INSTALL_DIR}/Versions/${FMK_VERSION}/Headers/\"\ncp -R \"${DEVICE_DIR}/${RES_BUNDLE}.bundle\" \"${INSTALL_DIR}/Versions/${FMK_VERSION}/Resources/\"\ncp -f \"${SRCROOT}/Support/${FMK_NAME}.xcconfig\" \"${INSTALL_DIR}/Versions/${FMK_VERSION}/Resources/\"\n\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\nlipo -create \"${DEVICE_DIR}/lib${SDK_TARGET}.a\" \"${SIMULATOR_DIR}/lib${SDK_TARGET}.a\" -output \"${INSTALL_DIR}/Versions/${FMK_VERSION}/${FMK_NAME}\"\n\n## 4. CREATE EMBEDDED FRAMEWORK\n\n# build embeddedframework folder and move framework into it\nmkdir \"${INSTALL_DIR}/../${FMK_NAME}.embeddedframework\"\nmv \"${INSTALL_DIR}\" \"${INSTALL_DIR}/../${FMK_NAME}.embeddedframework/${FMK_NAME}.framework\"\n\n# link Resources\nNEW_INSTALL_DIR=${TEMP_DIR}/${FMK_NAME}.embeddedframework\nmkdir \"${NEW_INSTALL_DIR}/Resources\"\nln -s \"../${FMK_NAME}.framework/Resources/${FMK_NAME}.xcconfig\" \"${NEW_INSTALL_DIR}/Resources/${FMK_NAME}.xcconfig\"\nln -s \"../${FMK_NAME}.framework/Resources/${RES_BUNDLE}.bundle\" \"${NEW_INSTALL_DIR}/Resources/${RES_BUNDLE}.bundle\"\n\n## 5. PACKAGE AND INSTALL\n\nrm -rf \"${PRODUCTS_DIR}/${FMK_NAME}.embeddedframework\"\nmv \"${NEW_INSTALL_DIR}\" \"${PRODUCTS_DIR}\"\n\n## 6. CLEAN\n\n# clean behind\nrm -r \"${TEMP_DIR}\"";
		};
